import * as React from 'react'
import axios from 'axios';
import { useState } from 'react'
import { useFormik } from 'formik'
import * as yup from 'yup';
import InputLabel from '@mui/material/InputLabel'
import MenuItem from '@mui/material/MenuItem'
import FormHelperText from '@mui/material/FormHelperText'
import FormControl from '@mui/material/FormControl'
import Select from '@mui/material/Select'
import TextField from '@mui/material/TextField';
import Map, { Marker } from 'react-map-gl';
import PropTypes from 'prop-types';
import Box from '@mui/material/Box';
import Collapse from '@mui/material/Collapse';
import IconButton from '@mui/material/IconButton';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Typography from '@mui/material/Typography';
import Paper from '@mui/material/Paper';
import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown';
import KeyboardArrowUpIcon from '@mui/icons-material/KeyboardArrowUp';

export default function Home() {
  const [kecamatan, setKecamatan] = React.useState('')
  const [dataKecamatan, setdataKecamatan] = React.useState('')
  const [jalan, setJalan] = React.useState('')
  const [error, setError] = useState(null)
  const [success, setSuccess] = useState(null)

  const handleChangeKecamatan = (event) => {
    setKecamatan(event.target.value)
    if (event.target.value === 'pilih') {
      setKecamatan('')
    }
  }

  const handleChangeJalan = (event) => {
    setJalan(event.target.value)
  }

  const handleLoadValue = async (value) => {
    const url = value.target.dataset.value
    if (url === 'pilih') {
      setdataKecamatan(value)
    }
    const result = await axios
      .get(`http://localhost:5000/home/${url}`)
      .catch((err) => {
        if (err) {
          setError(err)
          setSuccess(null)
        }
      })
    if (result) {
      setError(null);
      setdataKecamatan(result)
    }
  }

  // const ObjectTest =[
  //   {
  //       id : 1,
  //       name:'ABC'
  //   },
  //   {
  //       id: 3,
  //       name:'DEF'
  //   }]

  // const ObjectTest = JSON.stringify(dataKecamatan.data)
  // function _renderObject(){
	// 	return Object.entries(ObjectTest).map(([key, value], i) => {
	// 		return (
	// 			<div key={key}>
	// 				no: {value.no}
	// 				no_ruas: {value.no_ruas}
	// 			</div>
	// 		)
	// 	})
	// }
  // console.log(ObjectTest)

  function Row(props) {
    const { row } = props;
    const [open, setOpen] = React.useState(false);
  
    return (
      <React.Fragment>
        <TableRow sx={{ '& > *': { borderBottom: 'unset' } }}>
          <TableCell>
            <IconButton
              aria-label="expand row"
              size="small"
              onClick={() => setOpen(!open)}
            >
              {open ? <KeyboardArrowUpIcon /> : <KeyboardArrowDownIcon />}
            </IconButton>
          </TableCell>
          <TableCell component="th" scope="row">
            {row.name}
          </TableCell>
          <TableCell align="right">{row.calories}</TableCell>
          <TableCell align="right">{row.fat}</TableCell>
          <TableCell align="right">{row.carbs}</TableCell>
          <TableCell align="right">{row.protein}</TableCell>
        </TableRow>
        <TableRow>
          <TableCell style={{ paddingBottom: 0, paddingTop: 0 }} colSpan={6}>
            <Collapse in={open} timeout="auto" unmountOnExit>
